let entryContentStart = inputData.indexOf('<div class="entry-content">');
let entryContent = "";
let foundMethod = "";

if (entryContentStart !== -1) {
    console.log("‚úÖ Found <div class=\"entry-content\"> at position:", entryContentStart);

    // Find end of this div - look for closing </div>
    // But we need to be careful with nested divs
    let currentPos = entryContentStart + '<div class="entry-content">'.length;
    let divCount = 1; // Start with 1 because we're already in a div
    let endPos = -1;

    while (currentPos < inputData.length && divCount > 0) {
        let nextDiv = inputData.indexOf('<div', currentPos);
        let nextCloseDiv = inputData.indexOf('</div>', currentPos);

        if (nextCloseDiv === -1) break; // No more closing divs

        if (nextDiv !== -1 && nextDiv < nextCloseDiv) {
            // Found opening div before closing
            divCount++;
            currentPos = nextDiv + 4;
        } else {
            // Found closing div
            divCount--;
            if (divCount === 0) {
                endPos = nextCloseDiv;
                break;
            }
            currentPos = nextCloseDiv + 6;
        }
    }

    if (endPos !== -1) {
        entryContent = inputData.substring(entryContentStart + '<div class="entry-content">'.length, endPos);
        foundMethod = "Strategy 1: Precise div parsing";
        console.log("‚úÖ Extracted entry-content, length:", entryContent.length);
    }
}

// Fallback if we didn't find it or something went wrong
if (!entryContent || entryContent.length < 100) {
    console.log("‚ùå Strategy 1 didn't work, trying fallback");
    let match = inputData.match(/<div class="entry-content">([\s\S]*?)(?=<\/div>)/);
